import React from "react";
import { useNavigate } from "react-router-dom";

function Header() {
  const nav = useNavigate();

  function toUpload() {
    nav("/uploadProduct");
  }
  function toAllProd() {
    nav("/allProducts");
  }

  return (
    <div className="footer">
      <h3 onClick={nav("/profile")}>Profile</h3>
      <h3>Money: 300$</h3>
      <h3 onClick={toAllProd}>All products</h3>
      <h3 onClick={toUpload}>Upload Product</h3>
      <h3>My products:(3)</h3>
    </div>
  );
}

export default Header;
